import {Route, Routes} from "react-router-dom";
import Todo from "../components/todolist/Todo";

const mainRouter = () => {
    return(
        <Routes>
            <Route
                path={'/'}
                element={<div>Hello</div>}/>
            <Route
                path={'/todolist'}
                element={<Todo></Todo>}
            />
        </Routes>
    )
}

export default mainRouter;
